import './card.css';

export default function Cards ({nome, ra, codCurso, img}){

    nomeCurso = codCurso => {
        return codCurso === 19 ? 'Informática' : codCurso === 39 ? 'DS Vesp' : 'DS Not';
    }

    return(
        < div className='card'>
            <div className='imge'>
                <img src={img} width={150} height={150}/> 
            </div>
            <div className='nome'>
                {nome}
            </div>
            <div className='ra'>
                {ra}
            </div>
            <div className='codCurso'>
                Curso: {nomeCurso}
            </div>
        </div>
    )
}
